import React from "react";
import {useState} from 'react'

import './Card.css'

export default props =>{

    const [inputValueNome, setInputValue] = useState('');
    const inputValueSobrenome= useState('');
    const handleInputChange = (event) => {
        setInputValue(event.target.value);
      };
    return(
        <div className="Card">
            <form>
                <h1 className="titulo">Criar uma conta no Organo</h1>
                <p className="texto">Nome:</p>
                <input value={inputValueNome} onChange={handleInputChange} placeholder="Digite seu nome" className="entrada"></input>
                <p className="texto">Sobrenome:</p>
                <input value={inputValueSobrenome}  placeholder="Digite seusobrenome" className="entrada" value=''></input>
                <p className="texto">Email:</p>
                <input placeholder="Ex.: leticia@mail.com" className="entrada"></input>
                <p className="texto">Senha:</p>
                <input type="password" placeholder="Digite sua senha: " className="entrada"></input>
                <p className="texto">Senha (confirmação):</p>
                <input type="password" placeholder="Digite sua senha: "  className="entrada"></input>
                <p className="texto">Escolha sua foto:</p>
                <input className="imagem" type="file" id="arquivo" name="arquivo"/>
                <div className="div-botao">
                    <input className="botao" type="submit" value="Cadastrar" onClick={handleInputChange}></input>
                </div>

            </form>
            
        </div>
    )
}
